<!DOCTYPE html>
<html lang="en" dir="ltr">
  <head>
    <meta charset="utf-8" />
    <meta
      name="viewport"
      content="width=device-width, initial-scale=1, maximum-scale=1.0, user-scalable=no"
    />
    <title></title>
    <script src="https://www.guidedtrack.com/assets/jquery_gt.js"></script>
    <script src="https://www.guidedtrack.com/assets/interpreter.js"></script>
    <link
      rel="stylesheet"
      type="text/css"
      href="https://www.guidedtrack.com/assets/bootstrap.css"
    />
    <link
      rel="stylesheet"
      type="text/css"
      href="https://www.guidedtrack.com/assets/guidedtrack.css"
    />
    <link rel="stylesheet" type="text/css" href="custom.css" />
  </head>
  <body>
    <div
      aria-live="polite"
      class="guidedtrack program_container"
      data-environment="production"
      id="keipqgk"
    >
      <div id="program_navigation">
        <div id="back-button"></div>
        <div class="navigation_container"></div>
        <div id="run-menu"></div>
        <div class="points">
          <div class="total"></div>
          <div class="change"></div>
        </div>
      </div>
      <div class="maintain"></div>
      <div class="main"></div>
    </div>

    <script src="https://cdn.jsdelivr.net/npm/vue@2.6.14"></script>
    <script src="app.js"></script>
  </body>
</html>
